--This model shows all queries raised this month. Run this model once as a newly-initialised table, then run it as incremental going forward.
{{
    config(
        materialized='incremental'
    )
}}

SELECT DISTINCT 
*
FROM `bigquery-public-data.stackoverflow.posts_questions` 
where tags NOT like '%comments%'
AND creation_date > '2020-05-01T00:00:00+00:00'
ORDER BY creation_date DESC

--This model shows the the user IDs that have achieved the highest scores for their answers, grouped by tags
{{
    config(
        materialized='table'
    )
}}
 
select DISTINCT 
    tags,
    last_editor_user_id AS sme_user_id,
    max_score AS max_score
    FROM {{ ref('index_query_volumes')}} a
    INNER JOIN (
    SELECT 
    tags AS tags2,
    MAX(max_score) as max_score2
    FROM {{ ref('index_query_volumes')}}
    GROUP BY tags2
    ) b 
    ON a.tags = b.tags2 AND a.max_score = b.max_score2
    order by 3 DESC

--This model shows the the user IDs that have achieved the highest scores for their answers, grouped by tags
{{
